import React from 'react'
import Chart from '../Chart/Chart'

function ExpensesChart(props) {
    const chartDataPoints = [
        {label: 'Jan', value : 0},
        {label: 'Feb', value : 0},
        {label: 'Mar', value : 0},
        {label: 'Apr', value : 0},
        {label: 'May', value : 0},
        {label: 'Jun', value : 0},
        {label: 'Jul', value : 0},
        {label: 'Aug', value : 0},
        {label: 'Sep', value : 0},
        {label: 'Oct', value : 0},
        {label: 'Nov', value : 0},
        {label: 'Dec', value : 0},
    ];

    const time = new Date();
    time.setHours(0, 0, 0);

    const hour = time.getHours()+ 1;
    const min = time.getMinutes() + 50;

    const timeResult = (hour * 60) + min;

    for(const expense of props.expenses){
        const expenseTime = expense.time;
        let hourSlice = expenseTime.slice(0,2);
        let timeSlice = expenseTime.slice(2);


        console.log(hourSlice, timeSlice);

        const expenseMonth = expense.date.getMonth(); // Starting at 0(Jan)
        chartDataPoints[expenseMonth].value += expense.time;
    }

    return (
        <div>
            <Chart dataPoints={chartDataPoints}/>
        </div>
    )
}

export default ExpensesChart
